import axios from "axios";
import { render } from "nunjucks";
import React, { useEffect } from "react";

export default class SetSelect extends React.Component {
    state = {
        sets : []
    }


    componentDidMount() {
        axios.get("https://api.scryfall.com/sets")
        .then(res => {
            const sets = res.data.data;
            this.setState({ sets })
        })
    }

    render() {
        return (
            <select>
                {
                sets.map(sets =>
                    <option key={sets.id}>{sets.name}</option>)
                }
            </select>
        )
    }
}
